<html><title>Oitenta e nove</title><body>&#10;<p> &#10;O <b>oitenta e nove</b> (<b>89</b>, <b>LXXXIX</b>) &eacute; um <a href="http://en.wikipedia.org/wiki/N%C3%BAmero_inteiro" id="w">n&uacute;mero inteiro</a>. Ele &eacute; precedido pelo <a href="http://en.wikipedia.org/wiki/Oitenta_e_oito" id="w">88</a> e sucedido pelo <a href="http://en.wikipedia.org/wiki/Noventa" id="w">90</a>. Ele tamb&eacute;m &eacute; o d&eacute;cimo primeiro n&uacute;mero da <a href="http://en.wikipedia.org/wiki/Sucess%C3%A3o_de_Fibonacci" id="w">Sucess&atilde;o de Fibonacci</a>.</p>&#10;<p> </p>&#10;<p> &#10;<a href="http://en.wikipedia.org/wiki/Categoria:Inteiros" id="w">#089</a></p>&#10;</body></html>
